						<div itemprop="articleBody">
		<p><span style="line-height: 1.3em;"><strong>Indkaldelse til Generalforsamling i Danske Kvindelige Lægers Forening</strong></span></p>
<p><strong>Tirsdag d. 22 april, 2014 </strong></p>
<p>Kl.18:30</p>
<p>Auditoriet, Hovedvejen, Indgang 4</p>
<p>Frederiksberg Hospital,</p>
<p>Nordre Fasanvej 57</p>
<p>2000 Frederiksberg</p>
<p>1.Valg af dirigent.</p>
<p>2.Mundtlig beretning ved formanden.</p>
<p>3.Godkendelse af revideret regnskab for 2013-14.</p>
<p>4.Fastlæggelse af kontingent.</p>
<p>5.Forslag fra medlemmer</p>
<p>6.Valg til bestyrelsen. Ingen bestyrelsesmedlemmer er på valg. Der er to suppleanter og begge er på valg; Liselotte stiller op igen; Agnete ønsker ikke at stille op igen. Da vi skal have tre suppleanter, har bestyrelsen forslag til en kandidat – medlemmerne bedes komme med forslag til yderligere kandidater.</p>
<p>7.Valg af revisorer. Birgitte ønsker ikke at genopstille; medlemmerne bedes foreslå kandidater til revisor posten.</p>
<p>8.Eventuelt.</p>
<p>På bestyrelsens vegne</p>
<p>Birte Holm Sørensen</p>
<p>Hellerup d. 22. marts 2013</p>	</div>

	
